import { Switch, Route } from "react-router-dom"
import { Cart } from "../components/Cart"
import { Products } from "../components/Products"

export const Routes = () => {
    return (
        <Switch>
            <Route exact path="/"> <Products /> </Route>
            <Route path="/cart"> <Cart /> </Route>
        </Switch>
    )
}
